import React from 'react';
import styled from 'styled-components';
import Link from 'next/link';
const JoinComponent: React.FC = () =>{
    return(
        <JoinWrap>
            <JoinContainer>
                <LoginHeader>
                    <Link href="/">
                        <a>Choi Tech</a>
                    </Link>
                </LoginHeader>
                <JoinContent>
                    <h1>회원 정보를 입력해주세요.</h1>
                    <p>id or email</p>
                    <div>
                        <input type="text" />
                        <button>중복확인</button>
                    </div>
                </JoinContent>
            </JoinContainer>
        </JoinWrap>
    );
}

const JoinWrap = styled.div`
    
`;

const JoinContainer = styled.div`
    width:360px;
    margin: 150px auto;  
    &>h1{
        margin:0px 0px 20px 0px;
        font-size:26px;
    }
`;
const LoginHeader = styled.div`
    text-align:center;
    &>a{
        font-family: 'Audiowide',cursive;
        text-decoration:none;
        color:#333333;
        font-size:32px;
    }
`;

const JoinContent = styled.div`
    &>h1{
        font-size:16px;
        font-weight:400;
    }
    &>p{
        margin:0;
    }
    &>div{
        display:flex;
        justify-content:space-between;
        &>input{
            width:65%;
            height:45px;
        }
        &>button{
            width:30%;
        }
    }
`;
export default JoinComponent;
